package com.troyforever.env.bean;

public class ShedCorp {

	private Integer id ;
	
	private Shed shed ;
	
	private Corp corp ;

	public Integer getId() {
		return id;
	}

	public void setId(Integer id) {
		this.id = id;
	}

	public Shed getShed() {
		return shed;
	}

	public void setShed(Shed shed) {
		this.shed = shed;
	}

	public Corp getCorp() {
		return corp;
	}

	public void setCorp(Corp corp) {
		this.corp = corp;
	}
	
	
}
